            <Route path={'/works/1'}  component={Works}/>
            <Route path={'/works/2'}  component={Works}/>
            <Route path={'/works/3'}  component={Works}/>
          </BrowserRouter>
        </div>



      </div>
    )
  }
}
export default Works;
